func get_ip_point(ipid int, A []float64) *Point {
	ip := Ipoints[ipid]
	if ip != nil {
		var dist float64
		if A != nil {
			dist = dist_point_point(ip.X, A)
		}
		return &Point{-1, ipid, ip.X, dist, make(map[string][]float64)}
	}
