	}
	rx := regexp.MustCompile(`:([0-9]+)$`)
	rs := rx.FindStringSubmatch(myURL.Host)
	if len(rs) > 0 {
		port, err := strconv.Atoi(rs[1])
		if err == nil {
			urlMore.Port = port
		}
	}
}

