	ch := make(chan result, len(word))
	for i, l := range word {
		go func(i int, l string) {
			ch <- result{perm(word[:i] + word[i+1:]), l}
		}(i, string(l))
	}
	for i := 0; i < len(word); i++ {
		result := <-ch
