	return &Cursor{
		q: q,
		i: 0,
	}
}


type Cursor struct {
	q *Query
	i int
}

func (c *Cursor) Next() (Term, bool) {
	for ; c.i < len(c.q.db); c.i++ {
		candidate := c.q.db[c.i]
		if Arity(candidate) == c.q.arity && Name(candidate) == c.q.name {
			c.i++
			return candidate, c.i < len(c.q.db)
		}
	}
	return nil, false
}

