type Task interface {
	Execute() error
}

type namedTask struct {
	name string
	task Task
}


type ParallelTask struct {
	tasks []*namedTask
}


func NewParallelTask() *ParallelTask {
	return &ParallelTask{tasks: make([]*namedTask, 0)}
}





func (pt *ParallelTask) Summary() string {
	return buildTaskSummary(pt.tasks, ", ", false)
}


func (pt *ParallelTask) Execute() error {
	errChan := make(chan error)
	var wg sync.WaitGroup

	for _, nt := range pt.tasks {
		wg.Add(1)
		go func(t Task) {
			if err := t.Execute(); err != nil {
				errChan <- err
			}
			wg.Done()
		}(nt.task)
	}

	resultChan := make(chan error)
	go func() {
		var result *multierror.Error
		for err := range errChan {
			result = multierror.Append(result, err)
		}
		resultChan <- result.ErrorOrNil()
	}()

	wg.Wait()
	close(errChan)

	return <-resultChan
}

func (pt *ParallelTask) AddTask(name string, task Task)

