func match(p, s string) bool {
	m := make(map[rune]bool)
	for _, r := range s {
		m[r] = true
	}
	var e string
	for _, r := range p {
		if m[r] {
			e += string(r)
		}
	}
	return e == s
}

func check(p string, log []string) bool {
	for _, s := range log {
		if !match(p, s) {
			return false
		}
	}
	return true
