	logs, err := tools.ReadFile(path)
	if err != nil {
		log.Fatal(err)
	}

	exist := make(map[string]bool)
	var unique []string
	for _, v := range logs {
		if !exist[v] {
			unique = append(unique, v)
			exist[v] = true
		}
	}

	for p := range tools.Perms([]int{0, 1, 2, 3, 6, 7, 8, 9}) {
		psw := tools.JoinIntsString(p...)
		if check(psw, unique) {
			return psw
		}
	}

	return ""
}

