func qsortInt(nums []int) []int {
	if len(nums) <= 1 {
		return nums
	}

	head, tail := 0, len(nums)-1
	idx, mid := 1, nums[0]
	for head < tail {
		if nums[idx] > mid {
			nums[idx], nums[tail] = nums[tail], nums[idx]
			tail--
		} else {
			nums[idx], nums[head] = nums[head], nums[idx]
			head++
			idx++
		}
	}
	nums[head] = mid
	qsortInt(nums[:head])
	qsortInt(nums[head+1:])
	return nums
}

