	ch := make(chan Grapher)

	go func() {
		var stack nodeStack

		stack.Init()
		stack.Push(sg)

		for !stack.Empty() {
			n := stack.Pop()
			ch <- n
			children := n.GetChildren()
			for i := len(children) - 1; i >= 0; i-- {
				stack.Push(children[i])
			}
		}
		close(ch)
	}()

