func getMultiples(limit int, divisors []int) (set map[int]bool) {
	set = map[int]bool{}
	for _, divisor := range divisors {
		multiples := getMultiplesForDivisor(limit, divisor)
		for _, multiple := range multiples {
			set[multiple] = true
		}
	}
	return set
