func getMultiplesForDivisor(limit int, divisor int) (multiples []int) {
	if divisor == 0 {
		return multiples
	}
	multiplyer := 1
	candidate := divisor * multiplyer
	for candidate < limit {
		multiples = append(multiples, candidate)
		multiplyer += 1
		candidate = divisor * multiplyer
	}
	return multiples
}

