func GradientChecking(fn func([]float64) float64, theta []float64, epsilon float64) float64 {
	var x, y []float64
	for i := 0; i < len(theta); i++ {
		x = append(x, theta[i]+epsilon)
		y = append(y, theta[i]-epsilon)
	}
	checking := (fn(x) - fn(y)) / 2 * epsilon
